import React from 'react'
import './video.css'
import Divisor from '../../common/divisor/index'

function Video() {
    return (
        <div>
            <iframe width="560" height="315" src="https://www.youtube-nocookie.com/embed/NYdrAIPLhIw" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div>
    )
}

export default Video
